import React from "react";
import "./Train_part.css";
import Train_vdo from "./Train_vdo";



function Train_part() {
    return (
        <>
            <div className="Outer_Div">
                <div className="Inner_Div">
                    <div className="VDO1_DIV"><Train_vdo /></div>
                    <div className="Curr_in_div"><label><span className="Curr_in_span"><strong>3</strong></span></label></div>
                    <div className="VDO2_DIV"><Train_vdo /></div>
                    <div className="Curr_out_div"><label><span className="Curr_out_span"><strong>9</strong></span></label></div>
                </div>
            </div>
        </>
    );

}
export default Train_part;
